def svg_text_to_icon(svg_text):
    # Create a QSvgRenderer from the SVG bytes
    svg_bytes = QByteArray(svg_text.encode('utf-8'))

    renderer = QSvgRenderer(svg_bytes)

    # Create a QPixmap to hold the rendered SVG image
    pixmap = QPixmap(24, 24)  # Define the size of the pixmap
    pixmap.fill(Qt.transparent)

    # Use a QPainter to render the SVG onto the pixmap
    painter = QPainter(pixmap)
    renderer.render(painter)
    painter.end()  # Finish the painting

    return pixmap

